import React, { Component } from "react";
import { Variables } from '../Variable';
import "bootstrap/dist/css/bootstrap.min.css"; // Import Bootstrap CSS
import axios from "axios";

class DoctorPost extends Component {
  constructor(props) {
    super(props);
    this.state = {
      doctorName: "",
      imageFile: null,
      gender: "",
      phone: "",
      email: "",
      experience: 0,
      licenseNumber: "",
      tesimonials: ""
    };
  }

  handleInputChange = (event) => {
    this.setState({ [event.target.name]: event.target.value });
  };

  handleImageChange = (event) => {
    this.setState({ docImagePath: event.target.files[0] });
  };

  handleSubmit = (event) => {
    event.preventDefault();

    const formData = new FormData();
    formData.append("doctorName", this.state.doctorName);
    formData.append("docImagePath", this.state.docImagePath);
    formData.append("gender", this.state.gender);
    formData.append("phone", this.state.phone);
    formData.append("email", this.state.email);
    formData.append("experience", this.state.experience);
    formData.append("licenseNumber", this.state.licenseNumber);
    formData.append("tesimonials", this.state.tesimonials);

    axios
      .post(Variables.API_URL + "Doctors", formData)
      .then((response) => {
        console.log("Doctor created:", response.data);
        // Perform any necessary actions after successful creation
      })
      .catch((error) => {
        console.error("Error", error);
        // Handle the error appropriately
      });
  };

  render() {
    return (
      <div className="container">
        <br />
        <h2>Create Doctor</h2>
        <form onSubmit={this.handleSubmit}>
          <div className="form-group">
            <label>Doctor Name</label>
            <input
              type="text"
              name="doctorName"
              className="form-control"
              onChange={this.handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Gender</label>
            <input
              type="text"
              name="gender"
              className="form-control"
              onChange={this.handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Phone</label>
            <input
              type="text"
              name="phone"
              className="form-control"
              onChange={this.handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Email</label>
            <input
              type="email"
              name="email"
              className="form-control"
              onChange={this.handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Experience</label>
            <input
              type="number"
              name="experience"
              className="form-control"
              onChange={this.handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label>License Number</label>
            <input
              type="text"
              name="licenseNumber"
              className="form-control"
              onChange={this.handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Tesimonials</label>
            <input
              type="text"
              name="tesimonials"
              className="form-control"
              onChange={this.handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Image</label>
            <input
              type="file"
              name="docImagePath"
              className="form-control-file"
              onChange={this.handleImageChange}
              required
            />
          </div>
          <button type="submit" className="btn btn-primary">
            Create
          </button>
        </form>
      </div>
    );
  }
}

export default DoctorPost;
